script: |
  super -f text -I q9402.spq | sort > q9402.out

inputs:
  - name: q9402.spq
    data: |
      SELECT ( - 55 ), col2 FROM tab0 (FORMAT parquet) WHERE ( col2 * - + col0 - - 17 < - col0 + - + col0 + + + 1 );
  - name: tab0

outputs:
  - name: q9402.out
    data: |
      -55	10
      -55	47
      -55	99
